export default function ShortGallery() {
  const sGallery = [1, 2, 3, 4, 5, 6, 7, 8];

  return sGallery.map((pic, index) => {
    return <img
      key={index}
      src={`../../../images/shortGallery/Editar${pic}`}
      alt='picture'
    />
  })
}
